import React, { Component } from 'react'

export default class StudentTable extends Component {

    constructor(props){
        super(props)

        this.state= {
            students: []
        }
    }
    render() {
        return (
            <div>
                <h2>Student Lists</h2>
                <table>

                <thead>
                <tr>

                    <th>First Name</th>
                    <th>Last Name</th>
                    <th>Email</th>
                </tr>
                </thead>


                <tbody>
                    {
                        this.state.students.map(
                            students=>
                            <tr key={students.id}>
                                <td>{students.firstName}</td>
                                <td>{students.lastName}</td>
                                <td>{students.email}</td>
                            </tr>
                        )
                    }
                </tbody>


            </table>
        </div>
        )
    }
}
